// Combine all assets
const allAssets = [...nifty500Stocks, ...sp500Stocks, ...indianETFs, ...usETFs, ...indianMutualFunds];

export const extendedAssetDatabase = {
  getAssetInfo: (symbol: string): AssetInfo | null => {
    return allAssets.find(asset => asset.symbol.toUpperCase() === symbol.toUpperCase()) || null;
  },

  searchAssets: (query: string): AssetInfo[] => {
    const searchTerm = query.toLowerCase();
    return allAssets.filter(
      asset => 
        asset.symbol.toLowerCase().includes(searchTerm) ||
        asset.name.toLowerCase().includes(searchTerm) ||
        asset.sector.toLowerCase().includes(searchTerm)
    ).slice(0, 50); // Limit results for performance
  },

  getAssetsByClass: (assetClass: string): AssetInfo[] => {
    return allAssets.filter(asset => asset.assetClass === assetClass);
  },

  getAssetsBySector: (sector: string): AssetInfo[] => {
    return allAssets.filter(asset => asset.sector === sector);
  },

  getAssetsByRegion: (region: string): AssetInfo[] => {
    return allAssets.filter(asset => asset.region === region);
  },

  getAllSectors: (): string[] => {
    return Array.from(new Set(allAssets.map(asset => asset.sector))).sort();
  },

  getAllAssetClasses: (): string[] => {
    return Array.from(new Set(allAssets.map(asset => asset.assetClass))).sort();
  },

  getAllRegions: (): string[] => {
    return Array.from(new Set(allAssets.map(asset => asset.region))).sort();
  },

  getTotalAssetsCount: (): number => {
    return allAssets.length;
  },

  getStatistics: () => {
    return {
      totalAssets: allAssets.length,
      nifty500Count: nifty500Stocks.length,
      sp500Count: sp500Stocks.length,
      indianETFsCount: indianETFs.length,
      usETFsCount: usETFs.length,
      indianMutualFundsCount: indianMutualFunds.length,
      sectors: Array.from(new Set(allAssets.map(asset => asset.sector))).length,
      assetClasses: Array.from(new Set(allAssets.map(asset => asset.assetClass))).length,
      regions: Array.from(new Set(allAssets.map(asset => asset.region))).length
    };
  }
};

